import React from 'react';
import {Switch,Route } from 'react-router-dom';
import WelcomePage from './Components/welcomepage';

const Routes = () => (
    
    <Switch>
        <Route exact path="/" component={WelcomePage} />
    </Switch>
    
)



export default Routes;
